declare const SQL_QUERY = "\nINSERT INTO Returns (\n  \"party\", \"rank\", \"tally\", \"contestId\", \"turfId\"\n) VALUES (\n  @party, @rank, @tally, @contestId, @turfId\n)\nON CONFLICT (\"contestId\", \"turfId\", \"party\", \"rank\") DO UPDATE SET\n\"tally\" = IFNULL(@tally, \"tally\")\n";
export default SQL_QUERY;
